import base64
import cv2
import numpy as np
import imghdr

def read_b64(b64_string):


    img_b64decode = base64.b64decode(b64_string)
    extension = imghdr.what(None,h=img_b64decode) # base64 decoding
    img_array = np.frombuffer(img_b64decode, np.uint8) # convert np sequence
    img = cv2.imdecode(img_array, cv2.COLOR_BGR2RGB)
    # extension2 =  imghdr.what(None,h=img) 
    # print(extension2)
    retval, buffer = cv2.imencode('.'+"png", img) # convert image to JPEG format
    img_base64 = base64.b64encode(buffer).decode('utf-8') # convert image to base64 string
    return img_base64


